import React, { Component } from 'react';
import { Navbar, Form, Button, Row, Col, Container } from 'react-bootstrap';

import GlobalStyleSheet from '../styleSheet';
const styles = {
    submit_btn: {
        // background: `${GlobalStyleSheet.primry_color}`,
        // background: 'white',
        border: 'none',
        marginTop: '50px',
    },
    container: {
        background: `${GlobalStyleSheet.primry_color}`,
        margin: '50px',
        padding: '50px'
    }
}
class Login extends Component {
    state = {}
    render() {
        return (
            <div>
                <Navbar variant="dark" style={{ background: `${GlobalStyleSheet.primry_color}` }}>
                    <Navbar.Brand href="/" className="mr-auto" > Muhalik    </Navbar.Brand>
                    <Navbar.Brand href="#" className="mr-auto" > Login    </Navbar.Brand>
                </Navbar>
                <Row>
                    <div className="mr-auto"></div>
                    <div style={styles.container} className="mr-auto">
                        <Form>
                            <Form.Group as={Row} controlId="formPlaintextEmail">
                                <Form.Label column sm="2" style={styles.label}> Email </Form.Label>
                                <Col sm="10">
                                    <Form.Control type="email" required placeholder="email@example.com" />
                                </Col>
                            </Form.Group>

                            <Form.Group as={Row} controlId="formPlaintextPassword">
                                <Form.Label column sm="2" style={styles.label}> Password </Form.Label>
                                <Col sm="10">
                                    <Form.Control type="password" required placeholder="Password" />
                                </Col>
                            </Form.Group>
                            <Button variant="light" block type="submit" style={styles.submit_btn}> Login </Button>
                            <Button variant="light" block> Signup </Button>
                        </Form>
                    </div>
                </Row>
            </div>
        );
    }
}

export default Login;
